// file struct
typedef struct node
{
    char *fileName;
    int fileSize;
    char *pathToFile;

    struct node *next;
} fileList;

fileList *createNewRecord(const char *fileName, const int fileSize, const char *pathToFile)
{
    fileList *obj;

    obj = (fileList *)malloc(sizeof(fileList));
    obj->fileName = fileName;
    obj->fileSize = fileSize;
    obj->pathToFile = pathToFile;
    return (obj);
}

void addToList(fileList **list, fileList *obj)
{
    if (obj)
        obj->next = *list;
    *list = obj;
}

/*      prototypes start    */
fileList *findFiles();

void printTaskInfo();
void outputResultInConsole(const int numberOfFIles, fileList *searchResults);
void outputResultInFile(const int numberOfFIles, fileList *searchResults, const char *outputFilePath);
void searchFiles(const char searchingSymbol, int *numberOfFiles, const char *catalogPath, fileList *listOfFiles);

int main(int argc, char *argv[], char *envp[]);
/*      prototypes end    */

/*      search func start       */
void searchFiles(const char searchingSymbol, int *numberOfFiles, const char *catalogPath, fileList *listOfFiles)
{
    DIR *dir;
    struct dirent *entry;
    dir = opendir(catalogPath);
    if (!dir) // попытка отрыть каталог
    {
        printf("Ошибка при открытии %s!\n", catalogPath);
        return;
    };

    while ((entry = readdir(dir)) != NULL) // пока не кончатся файлы в каталоге
    {
        const char *slash = "/";
        char *fullPath = calloc(strlen(catalogPath) + strlen(slash) + strlen(entry->d_name), 1); // buff - после конкатенации становится полным путем к файлу, который
                                                                                                 // обнаружили с помощью if'a выше
        strcat(fullPath, catalogPath);
        strcat(fullPath, slash);
        strcat(fullPath, entry->d_name);
        if (entry->d_type == 4) // если тип файла - каталог
        {
            if (strcmp(entry->d_name, ".") != 0 && strcmp(entry->d_name, "..") != 0) // каталог не является текущим(.) или родительскиим(..)
            {
                searchFiles(searchingSymbol, numberOfFiles, fullPath, listOfFiles);
            }
        }
        else // иначе - любой другой тип файла
        {
            if (entry->d_name[0] == searchingSymbol) // если равны первый символ названия файла и символ для поиска
            {
                printf("Название: %s\n Размер: %d\n Полный путь: %s", entry->d_name, 1, fullPath);
                // addToList(&listOfFiles, createNewRecord(entry->d_name, 1, fullPath));
                // while (listOfFiles != NULL) //Неясно как идти по списку
                // {
                //     printf("%s, %d, %s\n", listOfFiles->fileName, listOfFiles->fileSize, listOfFiles->pathToFile);
                //     *listOfFiles = *listOfFiles->next;
                // }

                ++*numberOfFiles;
            }
        }
        free(fullPath);
    };
    closedir(dir);
}
/*      search func end       */

/*      print procedures start      */
void printTaskInfo()
{
    printf("\tДанная программа ищет в заданном каталоге и всех его подкаталогах все файлы,\n\tимена которых начинаются с заданного определенного символа.\n\tРезультаты выводятся на консоль и в указанный файл.\n\n");
}

void outputResultInConsole(const int numberOfFiles, fileList *searchResults)
{
    printf("\n\tВывод списка найденных файлов в консоль:\n");
    while (searchResults)
    {
        printf("\nПолное имя файла: %s\n", searchResults->fileName);
        printf("Размер файла: %d байт\n", searchResults->fileSize);
        printf("Путь к файлу: %s\n", searchResults->pathToFile);

        searchResults = searchResults->next;
    }
}

void outputResultInFile(const int numberOfFiles, fileList *searchResults, const char *outputFilePath)
{
    printf("\n\tВывод списка найденных файлов в указанный файл...\n");
    FILE *outputFile;
    if ((outputFile = fopen(outputFilePath, "r")) == NULL)
    {
        printf("\t\tФайл не удалось открыть!\n");
        return;
    }
    for (int i = 0; i < numberOfFiles; i++)
    {
        fprintf(outputFile, "\nПолное имя файла: %s\n", searchResults[i].fileName);
        fprintf(outputFile, "Размер файла: %d байт\n", searchResults[i].fileSize);
        fprintf(outputFile, "Путь к файлу: %s\n", searchResults[i].pathToFile);
    }
    fclose(outputFile);
    printf("\tВывод списка найденных файлов в файл завершен!:\n");
}
/*      print procedures end        */

int main(int argc, char *argv[], char *envp[])
{
    const int NUM_OF_ARGS = 4;
    fileList *listOfFiles = NULL;

    printTaskInfo();
    if (argc != NUM_OF_ARGS)
    {
        fprintf(stderr, "Неверный ввод!\nФормат ввода: %s <заданный каталог> <символ для поиска> <файл вывода>\n", argv[0]);
        printf("Повторите запуск программы!");
        return 1;
    }

    const char *catalogPath = argv[1];
    const char symbolForSearch = argv[2][0]; // берем первый символ второго аргумента для поиска
    const char *outputFilePath = argv[3];

    int numberOfFiles = 0;

    searchFiles(symbolForSearch, &numberOfFiles, catalogPath, &listOfFiles);
    outputResultInConsole(numberOfFiles, listOfFiles);
    // outputResultInFile(numberOfFiles, &listOfFiles, outputFilePath);

    printf("колво: %d\n", numberOfFiles);

    free(listOfFiles);
    return 0;
}

#include <numeric>
#include <iostream>

using namespace std;

class Rational {
public:
    Rational() = default;

    Rational(int numerator)
        : numerator_(numerator)
        , denominator_(1) {
    }

    Rational(int numerator, int denominator)
        : numerator_(numerator)
        , denominator_(denominator) {
        Normalize();
    }

    int Numerator() const {
        return numerator_;
    }

    int Denominator() const {
        return denominator_;
    }

    friend std::ostream& operator<<(std::ostream& os, Rational& rat);
    friend std::istream& operator>>(std::istream& in, Rational& rat);
    

private:
    void Normalize() {
        if (denominator_ < 0) {
            numerator_ = -numerator_;
            denominator_ = -denominator_;
        }
        const int divisor = gcd(numerator_, denominator_);
        numerator_ /= divisor;
        denominator_ /= divisor;
    }
    
    int numerator_ = 0;
    int denominator_ = 1;
};

std::ostream& operator<<(std::ostream& os, Rational& rat){
    os << rat.Numerator() << "/" << rat.Denominator();
    return os;
}

std::istream& operator>>(std::istream& is, Rational& rat){
    char b;
    is >> rat.numerator_ >> b >> rat.denominator_;
    return is;
}

int main(){
    Rational rational;
    Rational rational1;

    std::cout << rational1;
}

import { Form as AntdForm } from 'antd'
import type React from 'react'
import { useEffect } from 'react'
import type { Control, FieldPath, FieldValues } from 'react-hook-form'
import { useController } from 'react-hook-form'

type AntdFormItemProps = React.ComponentProps<typeof AntdForm.Item>

export type FormItemProps<TFieldValues extends FieldValues = FieldValues> = {
  children: React.ReactNode
  control: Control<TFieldValues>
  name: FieldPath<TFieldValues>
} & Omit<AntdFormItemProps, 'name' | 'normalize' | 'rules' | 'validateStatus'>

// TODO: Support `onBlur` `ref`
// FIXME: `Touched` does not change in devtool
export const FormItem = <TFieldValues extends FieldValues = FieldValues>({
  children,
  control,
  name,
  help,
  ...props
}: FormItemProps<TFieldValues>) => {
  const { field, fieldState } = useController({ name, control })
  const form = AntdForm.useFormInstance()

  const handleNormalize: AntdFormItemProps['normalize'] = (value) => {
    field.onChange(value)
    return value
  }

  // watch field value here
  useEffect(() => {
    form.setFieldValue(name, field.value)
  }, [form, name, field.value])

  return (
    <AntdForm.Item
      {...props}
      name={name as string}
      initialValue={field.value}
      normalize={handleNormalize}
      validateStatus={fieldState.invalid ? 'error' : undefined}
      help={fieldState.error?.message ?? help}
    >
      {children}
    </AntdForm.Item>
  )
}

// Rust file server (Linux)
// In this example you can upload and download files make a log of last download and view it
// also you can invoke system commands and print the results as HTML
//
// ===== Cargo.toml =====
// [dependencies]
// tide = "0.16.0"
// async-std = { version = "1.6.0", features = ["attributes"] }
// serde = { version = "1.0", features = ["derive"] }
// tempfile = "3.5.0"
// csv = "1.1"
// chrono = { version = "0.4", features = ["serde"] }
//
use std::io::Error as IoError;
use std::path::Path;
use std::sync::Arc;

use async_std::{fs::OpenOptions, io};
use tempfile::TempDir;
use tide::prelude::*;
use tide::{Body, Request, Response, StatusCode, Redirect};

use std::{env};
use std::fs::File;
use std::path::PathBuf;
use csv::Writer;

use chrono::{Utc, Local, DateTime, Date};

use std::process::Command;

#[derive(Clone)]
struct TempDirState {
    tempdir: Arc<TempDir>,
}

impl TempDirState {
    fn try_new() -> Result<Self, IoError> {
        Ok(Self {
            tempdir: Arc::new(tempfile::tempdir()?),
        })
    }

    fn path(&self) -> &Path {
        self.tempdir.path()
    }
}

#[async_std::main]
async fn main() -> Result<(), IoError> {
   
    let mut app = tide::with_state(TempDirState::try_new()?);
    app.with(tide::log::LogMiddleware::new());


    app.at(":file")
        // $ curl -T ./a.txt localhost:8080 # this writes the file to a temp directory
        //
        .put(|req: Request<TempDirState>| async move {
            let path = req.param("file")?;
            let p = req.param("file").unwrap().to_string();
            let fs_path = req.state().path().join(path);

            let file = OpenOptions::new()
                .create(true)
                .write(true)
                .open(&fs_path)
                .await?;

            let bytes_written = io::copy(req, file).await?;
            println!("file written bytes {}", bytes_written);
             let export_folder = env::var("EXPORT_FOLDER").map_err(|_| {
                 io::Error::new(io::ErrorKind::NotFound, "set env variable EXPORT_FOLDER to export path")
             })?;

             // write to a csv the file and time we downloaded it
             let file_path = PathBuf::from(export_folder).join("input.csv");
             
             let utc_datetime: DateTime<Utc> = Utc::now();
             println!("{}", utc_datetime); 

			 let file = File::create(&file_path)?;
             let mut writer = Writer::from_writer(file);
             let f_desc = "file uploaded was ".to_string();
             let text = Utc::now().format("%Y-%m-%d %H:%M:%S:%Z").to_string();
             let records = vec![
                 vec![&f_desc, &p, &text],
             ];
             for record in records {
                    writer.write_record(record)?;
             }  
             writer.flush()?;
             
            Ok(json!({ "bytes": bytes_written }))
        })
        // $ curl localhost:8080/a.txt # this reads the file from the same temp directory and logs it to a file
        //
        .get(|req: Request<TempDirState>| async move {
             let path = req.param("file")?;
             let p = req.param("file").unwrap().to_string();
             let fs_path = req.state().path().join(path);
             
             let export_folder = env::var("EXPORT_FOLDER").map_err(|_| {
                 io::Error::new(io::ErrorKind::NotFound, "set env variable EXPORT_FOLDER to export path")
             })?;

             // write to a csv the file and time we downloaded it
             let file_path = PathBuf::from(export_folder).join("output.csv");
             
             let utc_datetime: DateTime<Utc> = Utc::now();
             println!("{}", utc_datetime); 
             
             if let Ok(body) = Body::from_file(fs_path).await {
			 let file = File::create(&file_path)?;
             let mut writer = Writer::from_writer(file);
             let f_desc = "file downloaded was ".to_string();
             let text = Utc::now().format("%Y-%m-%d %H:%M:%S:%Z").to_string();
             let records = vec![
                 vec![&f_desc, &p, &text],
             ];
             for record in records {
                    writer.write_record(record)?;
             }  
             writer.flush()?;

             Ok(body.into())
            } else {
                Ok(Response::new(StatusCode::NotFound))
            }
        });
        // curl localhost:8080/showlastdownload
        //       
        app.at("/showlastdownload").get(|_req: Request<TempDirState>| async move {
             let export_folder = env::var("EXPORT_FOLDER").map_err(|_| {
                 io::Error::new(io::ErrorKind::NotFound, "set env variable EXPORT_FOLDER to export path")
             })?;

             // write to a csv the file and time we downloaded it
             let file_path = PathBuf::from(export_folder).join("output.csv");
             let output = Command::new("/bin/cat")
                     //.arg("/home/mark/enfile/output.csv") <---- if you dont want to use the env variable
                     .arg(&file_path)
                     .output()
                     .expect("failed to execute process");
            println!("status: {}", output.status);
            println!("stdout: {}", String::from_utf8_lossy(&output.stdout));
            println!("stderr: {}", String::from_utf8_lossy(&output.stderr));
            Ok(tide::Response::builder(200)
                 .body(format!("<html><h2>Download csv :-, {}!</h2></html>",
                  String::from_utf8_lossy(&output.stdout)))
                 .header("Server", "tide")
                 .content_type(tide::http::mime::HTML)
                 .build())
        });   
        // curl localhost:8080/showlastupload
        //  
        app.at("/showlastupload").get(|_req: Request<TempDirState>| async move {
             let export_folder = env::var("EXPORT_FOLDER").map_err(|_| {
                 io::Error::new(io::ErrorKind::NotFound, "set env variable EXPORT_FOLDER to export path")
